import React from 'react';
import './App.css'
const blog = (state)=>{
const {items}=state;
const blogin = items.map(item=>{
    items.push(item);
    return (
    <div key={item.id}>
        item.name
        </div>

)
})

return(
<div key={items.id}>
    <form onSubmit={blogin}>
    <input type="text" placeholder='Add course'/>
    <button>Add Course</button>
    </form>
  
</div>

)


}
export default blog;
